function studentsList()
{
    const Students = [
        "Miroj",
        "Manjila",
        "Rohit",
        "Sushil",
        "Simon"
    ]; 
    return
    (
    <div className = "studentsList">
        {Students.map((student) => (<h1>{student}</h1>))}
    </div>
    );
}

export default studentsList;
